import React, { Component } from 'react';
import App from './_app';
import { Router, Route, IndexRoute, browserHistory } from 'react-router'

class Index extends Component {
  render() {
    return (
      <Router history={browserHistory}>
        <App />
      </Router>
    )
  }
}

export default Index;
